     */
    static associate(models) {
      // define association here
    }
  }
  Allcode.init({
    key: DataTypes.STRING,
    type: DataTypes.STRING,
    value: DataTypes.STRING,
    valueVi : DataTypes.STRING,
    valueEn : DataTypes.STRING
  }, {
    sequelize,
    modelName: 'Allcode',
  });
  return Allcode;
};

